  return (
    <div className="text-center justify-center text-xl">
      <div className="font-bold text-3xl uppercase border-b rounded-xl text-center max-w-2xl mx-auto mt-12 p-2 bg-gradient-to-r from-indigo-600 to-pink-600 bg-clip-text text-transparent ">
        <p className="  ">How i got into Software...</p>
      </div>
      <div className=" text-center  mt-4 p-2 text-gray-100  bg-clip-text text-transparent">
        <p>
          Hey, I am Arshad Ali, a software Developer (FULL-STACK) based out of
          Delhi, India Location. I have done my Graduation from{" "}
          <a href="http://www.ipu.ac.in/" target="_blank" className="border-b ">
            Indraprastha University
          </a>{" "}
          in Electronics(Major) and computer Science(Minor) but in the last year
          of my college, I have decided to focus more on Computer science which
          leads me to enter fully into the Software Domain.
        </p>
      </div>
      <div className=" text-center p-2  text-gray-100 bg-clip-text text-transparent">
        <p>
          During My college time, I have tried to start a start-up and have also
          got a chance to meet the{" "}
          <a
            href="https://www.nsrcel.org/"
            target="_blank"
            className="border-b"
          >
            NSRCEL's (IIMB)
          </a>{" "}
          faculty to brainstorm over my idea and guess I got in failed what I
          brought to the table.I take this rejection to act as fuel for me to
          learn new things and build some new stuff and I proudly wear this
          Failure badge as an honour but not as something like a failure.
        </p>
      </div>
    </div>
  );
};

export default AboutMe;
